import React from "react";
import "./Products_and_Services.css";
import images from "../../constant/images";
const Products_and_Services = () => {
  return (
    <main>
      <div className="productAndServices_sec">
        <div className="productAndServices_inner">
          <div className="productAndServices_us">
            <h1>Products and Services</h1>
            <p style={{ width: "500px" }}>
              <h4> Plastic Virgin Resins:</h4> Our platform offers a
              comprehensive range of plastic virgin resins, including PP, PE,
              PS, PVC, and PET. These high-quality resins are sourced from
              trusted suppliers, ensuring consistent performance and
              reliability. Whether you require specific grades, colors, or
              quantities, Plastaps provides a wide selection to meet your unique
              needs.
            </p>
            <p style={{ width: "500px" }}>
              <h4> Plastic Virgin Resins:</h4> Our platform offers a
              comprehensive range of plastic virgin resins, including PP, PE,
              PS, PVC, and PET. These high-quality resins are sourced from
              trusted suppliers, ensuring consistent performance and
              reliability. Whether you require specific grades, colors, or
              quantities, Plastaps provides a wide selection to meet your unique
              needs.
            </p>
            <p style={{ width: "500px" }}>
              <h4> Plastic Virgin Resins:</h4> Our platform offers a
              comprehensive range of plastic virgin resins, including PP, PE,
              PS, PVC, and PET. These high-quality resins are sourced from
              trusted suppliers, ensuring consistent performance and
              reliability. Whether you require specific grades, colors, or
              quantities, Plastaps provides a wide selection to meet your unique
              needs.
            </p>
          </div>
          <div className="productAndServices_img">
            <img
              src={images.aboutus}
              className="productAndServices_image_size"
            />
          </div>
        </div>
      </div>
    </main>
  );
};

export default Products_and_Services;
